import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import Logo from '../Icons/icons8-sakura-96.png';

function Nav() {


  return (

    <nav>
    <img src={Logo}  alt="logo" />
      <ul className="nav-links">

        <li><h2>Graphs</h2></li>

        <li><h2>Map</h2></li>

      </ul>
    </nav>
  );
}
export default Nav;
